import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';

function AdditionalDetailsPage() {
  const [plantDetails, setPlantDetails] = useState(null);
  const { id } = useParams();

  useEffect(() => {
    console.log('Fetching additional details...');
    fetch(`http://localhost:8081/plantdetails/${id}`)
      .then(res => {
        if (!res.ok) {
          throw new Error('Failed to fetch additional details');
        }
        return res.json();
      })
      .then(data => {
        console.log('Additional details fetched:', data);
        setPlantDetails(data);
      })
      .catch(err => console.error('Error fetching additional details:', err));
  }, [id]);
  

  if (!plantDetails) {
    return <div>Loading additional details...</div>;
  }

  return (
    <div className="p-4">
      <h1 className="text-2xl font-semibold">Additional Details</h1>
      <div className="p-4 my-4 border border-gray-300 rounded-lg bg-gray-50">
        <h2 className="font-semibold text-xl">Plant Name: {plantDetails.name}</h2>
        <p className="mt-2">Scientific Name: {plantDetails.scientific_name}</p>
        {/* Add more details here */}
      </div>
    </div>
  );
}

export default AdditionalDetailsPage;
